{"translationLines":[{"lineNumber":85441,"originalJapaneseLine":"「…………」","translatedEnglishLine":"\"........\""},{"lineNumber":85442,"originalJapaneseLine":"「お前達……」","translatedEnglishLine":"\"You guys...\""},{"lineNumber":85443,"originalJapaneseLine":"「……む、だって」","translatedEnglishLine":"\"...Mmm, but...\""},{"lineNumber":85444,"originalJapaneseLine":"「あんまり怒らないであげてよー。","translatedEnglishLine":"\"Don't get too mad at him.\""},{"lineNumber":85445,"originalJapaneseLine":"　政さん」","translatedEnglishLine":"Masaru.\""},{"lineNumber":85446,"originalJapaneseLine":"「だって、あの人……","translatedEnglishLine":"\"Because that person...\""},{"lineNumber":85447,"originalJapaneseLine":"　政宗様が好きだと趣味が悪いって……」","translatedEnglishLine":"...said that liking Lord Masamune is bad taste...\""},

{"lineNumber":85448,"originalJapaneseLine":"「いや、怒っているわけではない」","translatedEnglishLine":"\"No, it's not that I'm angry.\""},{"lineNumber":85449,"originalJapaneseLine":"「お前達を心配しただけだ」","translatedEnglishLine":"\"I was just worried about you guys.\""},{"lineNumber":85450,"originalJapaneseLine":"「政宗様ぁ……」","translatedEnglishLine":"\"Lord Masamune...\""},{"lineNumber":85451,"originalJapaneseLine":"「やれやれ……」","translatedEnglishLine":"\"Good grief...\""},{"lineNumber":85452,"originalJapaneseLine":"「って、納得いかーーーん！」","translatedEnglishLine":"\"That doesn't make any sense!\""},{"lineNumber":85453,"originalJapaneseLine":"「なんでお前みたいな目玉妖怪が","translatedEnglishLine":"\"Why is an eyeball monster like you"},{"lineNumber":85454,"originalJapaneseLine":"　こんなにモテモテなんだー！」","translatedEnglishLine":"so popular?!\""},{"lineNumber":85455,"originalJapaneseLine":"「うっく、しかも普段俺には","translatedEnglishLine":"\"Ugh, and on top of that, even the maids who usually ignore me...\""},{"lineNumber":85456,"originalJapaneseLine":"　見向きもしないメイド達まで……」","translatedEnglishLine":"...pay attention to you.\""},{"lineNumber":85457,"originalJapaneseLine":"「そう言われてもな」","translatedEnglishLine":"\"Even if you say that...\""},{"lineNumber":85458,"originalJapaneseLine":"「丸さか！　やはり俺も丸くなればモテるのか！」","translatedEnglishLine":"\"Marusaka! Maybe if I become round like you, I'll be popular too!\""},{"lineNumber":85459,"originalJapaneseLine":"「シィル！　シィーーーール！","translatedEnglishLine":"\"Seele! Seeeele!\""},{"lineNumber":85460,"originalJapaneseLine":"　なんとかしろーーーー！」","translatedEnglishLine":"Do something!\""},{"lineNumber":85461,"originalJapaneseLine":"「あ、はいはい！」","translatedEnglishLine":"\"Ah, yes yes!\""},{"lineNumber":85462,"originalJapaneseLine":"「いえ……でもそれは無理なような」","translatedEnglishLine":"\"Well... but I don't think that's possible.\""},{"lineNumber":85463,"originalJapaneseLine":"「なせばなーーーーる！　行くぞ！」","translatedEnglishLine":"\"Where there's a will, there's a way! Let's go!\""},{"lineNumber":85464,"originalJapaneseLine":"「きゃっ！」","translatedEnglishLine":"\"Kya!\""},{"lineNumber":85465,"originalJapaneseLine":"まるで嵐のようにランス達は去って行った。","translatedEnglishLine":"Lance and the others left like a storm."},{"lineNumber":85466,"originalJapaneseLine":"「まったく、ここは騒がしいの……」","translatedEnglishLine":"\"Honestly, it's noisy here...\""},{"lineNumber":85467,"originalJapaneseLine":"「ま、それがいいとこじゃないかなー？","translatedEnglishLine":"\"Well, maybe that's the good part of that man's camp?\""},{"lineNumber":85468,"originalJapaneseLine":"　あの男の陣営の」","translatedEnglishLine":"\"That man's faction.\""},{"lineNumber":85469,"originalJapaneseLine":"「馬鹿なだけ……」","translatedEnglishLine":"\"They're just idiots...\""},{"lineNumber":85470,"originalJapaneseLine":"「あ、でも、私ここの雰囲気は好きですよ」","translatedEnglishLine":"\"Ah, but I like the atmosphere here.\""},{"lineNumber":85471,"originalJapaneseLine":"「明るくて、賑やかで」","translatedEnglishLine":"\"It's bright and lively.\""},{"lineNumber":85472,"originalJapaneseLine":"「人間とは出来るだけ仲良くな」","translatedEnglishLine":"\"We should get along with humans as much as possible.\""},{"lineNumber":85473,"originalJapaneseLine":"「ここはJAPANの奥州とは違うんだ」","translatedEnglishLine":"\"This place is different from Oshu in JAPAN.\""},{"lineNumber":85474,"originalJapaneseLine":"「はーい」","translatedEnglishLine":"\"Yes.\""},{"lineNumber":85475,"originalJapaneseLine":"「何を言う。","translatedEnglishLine":"\"What are you saying?"},{"lineNumber":85476,"originalJapaneseLine":"　どこにいても変わりはしない」","translatedEnglishLine":"It doesn't change no matter where we are.\""},{"lineNumber":85477,"originalJapaneseLine":"「梵天丸がいて、","translatedEnglishLine":"\"With Bontenmaru here,"},{"lineNumber":85478,"originalJapaneseLine":"　そこに我らがいれば……","translatedEnglishLine":"and if we are there..."},{"lineNumber":85479,"originalJapaneseLine":"　それが我らの奥州だ」","translatedEnglishLine":"That is our Oshu.\""},{"lineNumber":85480,"originalJapaneseLine":"「…………」","translatedEnglishLine":"\"........\""},{"lineNumber":85481,"originalJapaneseLine":"「ふっ……そうかもな」","translatedEnglishLine":"\"Heh... maybe that's right.\""},{"lineNumber":85482,"originalJapaneseLine":"織田城――","translatedEnglishLine":"Oda Castle --"},{"lineNumber":85483,"originalJapaneseLine":"「おー、懐かしの織田城」","translatedEnglishLine":"\"Oh, the nostalgic Oda Castle.\""},{"lineNumber":85484,"originalJapaneseLine":"ランス達がJAPANは尾張、織田城へと来ていた。","translatedEnglishLine":"Lance and the others had come to Oda Castle in Owari, JAPAN."},

{"lineNumber":85485,"originalJapaneseLine":"「……こうして無事な姿を見ると、","translatedEnglishLine":"\"...Seeing you safe like this,"},{"lineNumber":85486,"originalJapaneseLine":"　ホッとしますね」","translatedEnglishLine":"I feel relieved.\""},{"lineNumber":85487,"originalJapaneseLine":"「皆さん……っ」","translatedEnglishLine":"\"Everyone...\""},{"lineNumber":85488,"originalJapaneseLine":"「おっ！　五十六ではないか！」","translatedEnglishLine":"\"Oh! Isn't that Isoroku!\""},{"lineNumber":85489,"originalJapaneseLine":"ランスの姿を見つけた五十六が","translatedEnglishLine":"Isoroku, upon seeing Lance's figure,"},{"lineNumber":85490,"originalJapaneseLine":"深々と頭を下げた。","translatedEnglishLine":"bowed deeply."}]}

